import axios from "axios";
import * as cheerio from "cheerio";

const isTagElement = (element: any) => {
  return element?.attribs !== undefined;
};

export async function getCsrfToken() {
  let base: string = "https://codeforces.com";
  let cf_enter: string = base + "/enter";

  let csrf_token: string = "";

  const responseTest = await axios.get(cf_enter);
  const selectorTest = cheerio.load(responseTest.data);
  const neededData = selectorTest("head").children("meta");

  // console.log(neededData);

  for (let i: number = 0; i < neededData.length; i++) {
    if (neededData[i].attribs != null) {
      console.log(i);
    }

    // if (
    //   neededData[i].attribs.name === "X-Csrf-Token"
    // )
    //   csrf_token = neededData[i].attribs.content;
  }

  return csrf_token;
}
